import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const AboutSection = styled.section`
  min-height: 100vh;
  background: #f8f9fa;
  display: flex;
  align-items: center;
  padding: 100px 0;
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 4rem;
  align-items: center;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
    gap: 2rem;
  }
`;

const Content = styled.div`
  h2 {
    font-size: 3rem;
    font-weight: 700;
    color: #333;
    margin-bottom: 2rem;

    @media (max-width: 768px) {
      font-size: 2rem;
    }
  }

  p {
    font-size: 1.1rem;
    line-height: 1.8;
    color: #666;
    margin-bottom: 1.5rem;
  }
`;

const SkillsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 1rem;
  margin-top: 2rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const SkillCard = styled.div`
  background: white;
  padding: 1.5rem;
  border-radius: 12px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.05);
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-5px);
  }

  h3 {
    font-size: 1.2rem;
    font-weight: 600;
    color: #333;
    margin-bottom: 0.5rem;
  }

  p {
    font-size: 0.9rem;
    color: #666;
    margin: 0;
  }
`;

const ImageContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

const ProfileImage = styled.div`
  width: 300px;
  height: 300px;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 4rem;
  color: white;
  font-weight: 700;
  box-shadow: 0 20px 40px rgba(102, 126, 234, 0.3);

  @media (max-width: 768px) {
    width: 250px;
    height: 250px;
    font-size: 3rem;
  }
`;

const About = () => {
  return (
    <AboutSection id="about">
      <Container>
        <motion.div
          initial={{ opacity: 0, x: -50 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <Content>
            <h2>About Me</h2>
            <p>
              I'm a passionate fullstack engineer with a strong foundation in modern web technologies. 
              I love building scalable applications that solve real-world problems and provide exceptional 
              user experiences.
            </p>
            <p>
              With expertise in React for frontend development, Java Spring Boot for backend services, 
              PostgreSQL for data management, and AWS for cloud deployment, I bring a comprehensive 
              approach to fullstack development.
            </p>
            <p>
              I'm always eager to learn new technologies and take on challenging projects that push 
              the boundaries of what's possible in web development.
            </p>

            <SkillsGrid>
              <SkillCard>
                <h3>Frontend</h3>
                <p>React, JavaScript, HTML5, CSS3, Responsive Design</p>
              </SkillCard>
              <SkillCard>
                <h3>Backend</h3>
                <p>Java, Spring Boot, REST APIs, Microservices</p>
              </SkillCard>
              <SkillCard>
                <h3>Database</h3>
                <p>PostgreSQL, SQL, Database Design</p>
              </SkillCard>
              <SkillCard>
                <h3>Cloud & DevOps</h3>
                <p>AWS, Docker, CI/CD, Infrastructure</p>
              </SkillCard>
            </SkillsGrid>
          </Content>
        </motion.div>

        <motion.div
          initial={{ opacity: 0, x: 50 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <ImageContainer>
            <ProfileImage>
              JP
            </ProfileImage>
          </ImageContainer>
        </motion.div>
      </Container>
    </AboutSection>
  );
};

export default About;
